import web from "./images/coderman_img.jpg";
import {NavLink} from 'react-router-dom'
import Common from "./Common";
export default function Home() {
  return (
    <>
    <Home 
    name="Grow your bussiness with"
    visite="/service"
    btn="Get Started"
    img={web}
    />

    </>
  );
}
